import { Button, Card, Typography, Box, Grid } from "@mui/material";
import { Fragment, useState } from "react";
import UserCard from "./UserCard";
import data from "./data.json"




export default function List() {
    const user = data

    const style =

    {
        div: {
            background: "lightBlue",
            padding: "10px",
            textAlign: "center",

        },
        div2:{
            padding: "10px",
            textAlign: "center"
        },
        box: {
            justifyContent: "center",
            display: "flex",
            marginTop: "20px",
            background: "blue",
            alignContent: "center"

        }
    }



    return (

        <Fragment style={{marginLeft: "10px"}}>

            <h1>Socios</h1>
            <Box sx={{ flexGrow: 1 }} style={style.box}>
                <Grid container spacing={2}>

                    <Grid item xs={3} md={3}>
                        <div style={style.div2}>
                            Nombre
                        </div>
                    </Grid>
                    <Grid item xs={3} md={3}>
                        <div style={style.div2}>
                            Apellido
                        </div>
                    </Grid>
                    <Grid item xs={3} md={3}>
                        <div style={style.div2}>
                            DNI
                        </div>
                    </Grid>
                    <Grid item xs={2} md={3}>
                        <div style={style.div2}>
                            Fecha Nac.
                        </div>
                    </Grid>
                </Grid>

            </Box>

            {user.map(user => {
                return (

                    <Box sx={{ flexGrow: 1 }} style={style.box}>

                        <Grid container spacing={2}>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.nombre}
                                </div>


                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.apellido}
                                </div>


                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.dni}
                                </div>

                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.fecha}
                                </div>

                            </Grid>

                        </Grid>

                    </Box>

                )
            })}

        </Fragment>
    )

}
